import Svg, { Circle, Path } from 'react-native-svg';
import * as Animatable from 'react-native-animatable';
import { StyleSheet } from 'react-native';

export const PointerUp = ({ delay, left, vert }) => (
  <Animatable.View
    animation="fadeInUpBig"
    delay={delay}
    duration={Animations.SPEED_MED}
    style={styles.lineWrapper}
    left={left}
    top={vert}
  >
    <Svg height={16} width={16} style={styles.circle}>
      <Circle
        cx={8}
        cy={8}
        r={6}
        stroke={Colors.AQUA}
        strokeWidth={3}
        fill={Colors.AQUA}
      />
    </Svg>
    <Svg height={200} width={20} style={styles.line}>
    <Path d="M8 0 L8 200" stroke={Colors.AQUA} strokeWidth={3} />
    </Svg>
  </Animatable.View>
);

export const PointerDown = ({ delay, left, vert }) => (
  <Animatable.View
    animation="fadeInDownBig"
    delay={delay}
    duration={Animations.SPEED_MED}
    style={styles.lineWrapper}
    left={left}
    bottom={vert}
  >
    <Svg height={200} width={16} style={styles.line}>
      <Path d="M8 0 L8 200" stroke={Colors.AQUA} strokeWidth={3} />
    </Svg>
    <Svg height={16} width={16} style={styles.circle}>
      <Circle
        cx={8}
        cy={8}
        r={6}
        stroke={Colors.AQUA}
        strokeWidth={3}
        fill={Colors.AQUA}
      />
    </Svg>
  </Animatable.View>
);

const styles = StyleSheet.create({
  lineWrapper: {
    display: 'flex',
    height: 200,
    width: 16,
    position: 'absolute',
    //backgroundColor: Colors.DARK_RED,
  },
  line: {
    height: 200,
    width: 16,
    //backgroundColor: Colors.NAVY,
  },
  circle: {
    height: 20,
    width: 16,
    //backgroundColor: Colors.NAVY,
  },
});
